import React from 'react';
import search from './../../../search-259.svg'
import './searchBar.css'

function SearchBar() {
  return (
    <div className={'search-container'}>
        <input type={'text'} placeholder={'Search'}></input>
        <img src={search} />
    </div>
  );
}

export default SearchBar;
